module.exports = function(results) {
	// don't count obselete snapshot as a failure, but just check if there are no failing tests
	// console.dir(results)
	results.success = results.testResults.every(r => r.numFailingTests === 0)
	return results
}

module.exports = {
	moduleNameMapper: {
		"src/.*": "<rootDir>/dist/cjs/immer.cjs.production.js"
	},
	testEnvironmentOptions: {
		url: "http://localhost"
	},
	globals: {
		USES_BUILD: true
	},
	preset: "ts-jest/presets/js-with-ts",
	testEnvironment: "node",
	testMatch: ["**/__tests__/**/*.[jt]s?(x)"],
	snapshotResolver: "<rootDir>/jest.config.build.snapshots.js",
	testResultsProcessor: "<rootDir>/ignoreObseleteSnapshots.js"
}

module.exports = {
	// resolves from test to snapshot path
	resolveSnapshotPath: (testPath, snapshotExtension) =>
		testPath.replace("__tests__", "__tests__/__prod_snapshots__") +
		snapshotExtension,

	// resolves from snapshot to test path
	resolveTestPath: (snapshotFilePath, snapshotExtension) =>
		snapshotFilePath
			.replace("__tests__/__prod_snapshots__", "__tests__")
			.slice(0, -snapshotExtension.length),

	// Example test path, used for preflight consistency check of the implementation above
	testPathForConsistencyCheck: "some/__tests__/example.test.js"
}

module.exports = {
	testEnvironmentOptions: {
		url: "http://localhost"
	},
	preset: "ts-jest/presets/js-with-ts",
	testEnvironment: "node",
	testMatch: ["**/__tests__/**/*.[jt]s?(x)"]
}

import {defineConfig, Options} from "tsup"
import fs from "fs"

export default defineConfig(options => {
	const commonOptions: Partial<Options> = {
		entry: {
			immer: "src/immer.ts"
		},
		sourcemap: true,
		...options
	}

	const productionOptions = {
		minify: true,
		esbuildOptions(options, _context) {
			options.mangleProps = /_$/
		},
		define: {
			"process.env.NODE_ENV": JSON.stringify("production")
		}
	}

	return [
		// ESM, standard bundler dev, embedded `process` references
		{
			...commonOptions,
			format: ["esm"],
			dts: true,
			clean: true,
			sourcemap: true,
			onSuccess() {
				// Support Flow types
				fs.copyFileSync("src/types/index.js.flow", "dist/cjs/index.js.flow")
			}
		},
		// ESM, Webpack 4 support. Target ES2018 syntax to compile away optional chaining and spreads
		{
			...commonOptions,
			entry: {
				"immer.legacy-esm": "src/immer.ts"
			},
			// ESBuild outputs `'.mjs'` by default for the 'esm' format. Force '.js'
			outExtension: () => ({js: ".js"}),
			target: "es2017",
			format: ["esm"],
			sourcemap: true
		},
		// ESM for use in browsers. Minified, with `process` compiled away
		{
			...commonOptions,
			...productionOptions,
			entry: {
				"immer.production": "src/immer.ts"
			},
			format: ["esm"],
			outExtension: () => ({js: ".mjs"})
		},
		// CJS development
		{
			...commonOptions,
			entry: {
				"immer.cjs.development": "src/immer.ts"
			},
			format: "cjs",

			outDir: "./dist/cjs/"
		},
		// CJS production
		{
			...commonOptions,
			...productionOptions,
			entry: {
				"immer.cjs.production": "src/immer.ts"
			},
			format: "cjs",
			outDir: "./dist/cjs/",
			onSuccess: () => {
				// Write the CJS index file
				fs.writeFileSync(
					"dist/cjs/index.js",
					`
'use strict'

if (process.env.NODE_ENV === 'production') {
  module.exports = require('./immer.cjs.production.js')
} else {
  module.exports = require('./immer.cjs.development.js')
}`
				)
			}
		}
	]
})
